import "./products.css"
import pro from "../assets/images/items.png"

function Products(){
    return(
        <div>
            <div className="products-group">
            <h1 className="products-head">Discover our Products</h1>
            </div>
            <div>
                <img src={pro} width="600px"></img>
            </div>
        </div>
    )
}
export default Products;
